export default function Board() {
    return (

        <UpperHalf>
            <img src="./logo.png" alt="logo" />
            <PickarLogoWhite>
                pickar
            </PickarLogoWhite>
            <Headline>
                Convert currencies in real-time.
            </Headline>
            <Box />
            <ButtonHistory />
        </UpperHalf>
    )
}
